import React from 'react';

const HowToExcSec = () => {
    return (<>
        <div className="container-fluid">
            <div className="row">
                <div className="col-lg-10 col-md-11 mx-auto">
                    <h1 className="text-center font-weight-light">How does this exchange feature work?</h1>
                </div>
            </div>
        </div>
    </>)
}

export default HowToExcSec;
